    CashmemoDetailsReportComponent.prototype.commodityForBangalore = function (dataListFroCmdtyForBng) {
        var _this = this;
        if ($("#collectionMan").val() == 'KARTIK') {
            this.viewCommodityCombo = true;
            this.viewCommodity = false;
            //btnRecalculate.setVisible(true);
            this.isRecalculate = true;
            this.getCommodity();
            this.viewNewCollectionMans = false;
        }
        else {
            this.commodityAdmin = $("#agentName").val();
            this.lrDtoCommodityAdmin.source = this.commodityAdmin;
            this.lrDtoCommodityAdmin.consigneeId = this.consigneeId;
            this.lrDtoCommodityAdmin.companyId = this.userDataDtoReturnSession.companyId;
            this.masterReadService.getCommodityFromAdminRateMater(this.lrDtoCommodityAdmin).subscribe(function (response) {
                if (response) {
                    _this.commodityComboDataList = null;
                    //console.log(response);
                    _this.commodityComboDataList = response;
                    //console.log("Inside of service getCommodityFromAdminRateMater");
                    //console.log(this.commodityComboDataList);
                    if (_this.commodityComboDataList.length > 0) {
                        _this.viewCommodityCombo = true;
                        _this.viewCommodity = false;
                        _this.isRecalculate = true;
                        _this.viewNewCollectionMans = false;
                        _this.viewBtnRecalculate = true;
                        //$( "#commodityCombo" ).val( this.returnLrNumberDtls.column2 );
                        _this.commodityCombo = _this.returnLrNumberDtls.column2;
                    }
                    else {
                        _this.viewCommodityCombo = false;
                        _this.viewCommodity = true;
                        _this.isRecalculate = false;
                        _this.viewBtnRecalculate = false;
                        _this.viewNewCollectionMans = false;
                    }
                    _this.commodityComboTA = [];
                    for (var i = 0; i < _this.commodityComboDataList.length; i++) {
                        _this.commodityComboTA.push(_this.commodityComboDataList[i].commodityName);
                    }
                }
            }), function (error) { return sweetalert__WEBPACK_IMPORTED_MODULE_13___default()({
                title: "Server Error",
                text: "Problem occur while getting Commodity From Admin Rate Master",
                icon: "error",
                closeOnClickOutside: false,
                closeOnEsc: false,
            }); },
                function () { return console.log('done'); };
        }
    };
