    CashmemoDetailsReportComponent.prototype.subTotalWithDemurage = function () {
        this.enteredSrmDiscount = $("#srmDiscount").val();
        if (this.unit == null || this.unit == "") {
            this.calculateDisc();
        }
        else {
            if (this.unit == "Rate") {
                this.calculateDisc();
            }
            else if (this.unit == "Discount") {
                if (this.srmDiscount == "onLr" || this.srmDiscount == "onBaseFrgt") {
                    this.calculateDisc();
                }
                else if (this.srmDiscount == "onTotal") {
                    this.calculateDiscOnTotal();
                }
            }
        }
    };
