    CashmemoDetailsReportComponent.prototype.getConsigneeRateDetails = function (dataforConsigneeRateDetails) {
        var _this = this;
        if (this.userDataDtoReturnSession.mainStation == 'Chennai') {
            if (this.isAreaBasedLogic == true) {
                this.getOtherChgDetailsList($("#areaBillingDtlsFieldSet").val());
            }
            else {
                this.getOtherChgDetailsList($("#areaCollectionDtlsFieldSet").val());
            }
        }
        this.readonlyHamaliGd = false;
        this.masterReadService.getConsigneeRateDetailsForCashMemoService(dataforConsigneeRateDetails).subscribe(function (response) {
            _this.dataListReturnOfConsigneeRateDtls = response;
            // for guj 50% dis, no discount should calculate @Dated
            // :
            // 17/09/2018
            if (_this.returnLrNumberDtls.isGujDisc == true) {
                _this.dataListReturnOfConsigneeRateDtls = '';
            }
            if (_this.dataListReturnOfConsigneeRateDtls == '') {
                _this.setEditCompnayValues();
                $("#deliveryType").focus();
            }
            else {
                if (_this.isAreaBasedLogic == true) {
                    _this.readonlyHamaliGd = true;
                }
                else {
                    _this.readonlyHamaliGd = false;
                }
                _this.setFields(_this.dataListReturnOfConsigneeRateDtls);
                $("#deliveryType").focus();
            }
            if (_this.srmRate == "0.0" || _this.srmRate == "0") {
                _this.calculateDisc();
            }
            else if (_this.unit != null || _this.unit != "") {
                if (_this.unit == "Rate") {
                    _this.calculateDisc();
                }
                else if (_this.unit == "Discount") {
                    if (_this.srmDiscount == "onLr" || _this.srmDiscount == "onBaseFrgt") {
                        _this.calculateDisc();
                    }
                    else if (_this.srmDiscount == "onTotal") {
                        _this.calculateDiscOnTotal();
                    }
                }
            }
            _this.logicForGST();
            //console.log(this.dataListReturnOfConsigneeRateDtls.length);
        }), function (error) { return sweetalert__WEBPACK_IMPORTED_MODULE_13___default()({
            title: "Server Error",
            text: "Problem occur while getting Consignee Rate Details",
            icon: "error",
            closeOnClickOutside: false,
            closeOnEsc: false,
        }); },
            function () { return console.log('done'); };
    };
