    PaidReportComponent.prototype.viewTypeMode = function (viewType) {
        if (viewType === 'dummy') {
            this.viewTypeDateWise = true;
            this.viewTypePartyWise = false;
            this.viewTypeAgentWise = false;
            this.viewTypeDestinationWise = false;
            this.paidReportDateNdPartyWiseTable = true;
            this.paidReportAgentNdDestinationTable = false;
        }
        else if (viewType === 'PartyWise') {
            this.viewTypeDateWise = true;
            this.viewTypePartyWise = true;
            this.viewTypeAgentWise = false;
            this.viewTypeDestinationWise = false;
            this.paidReportDateNdPartyWiseTable = true;
            this.paidReportAgentNdDestinationTable = false;
        }
        else if (viewType === 'AgentWise') {
            this.viewTypeDateWise = true;
            this.viewTypePartyWise = false;
            this.viewTypeAgentWise = true;
            this.viewTypeDestinationWise = false;
            this.paidReportDateNdPartyWiseTable = false;
            this.paidReportAgentNdDestinationTable = true;
        }
        else if (viewType === 'DestWise') {
            this.viewTypeDateWise = true;
            this.viewTypePartyWise = false;
            this.viewTypeAgentWise = true;
            this.viewTypeDestinationWise = true;
            this.paidReportDateNdPartyWiseTable = false;
            this.paidReportAgentNdDestinationTable = true;
        }
        else {
            this.viewTypeDateWise = false;
            this.viewTypePartyWise = false;
            this.viewTypeAgentWise = false;
            this.viewTypeDestinationWise = false;
            this.paidReportDateNdPartyWiseTable = false;
            this.paidReportAgentNdDestinationTable = false;
        }
        //I have doubt in islocal Agent
        if (this.mainStationDesc == 'Bkg Main Admin Station' && !this.isLocalAgent) {
            this.viewTypeAgentWise = false;
        }
    };
    PaidReportComponent.prototype.logInPage = function () {
        this.router.navigate(['/authentication/login']);
    };
    //FromStation
    PaidReportComponent.prototype.getBookingOfficeDetails = function () {
        this.lrDtoBkgSrc.companyId = this.userDataDtoReturnSession.companyId;
        this.lrDtoBkgSrc.mode = "All";
    };
    //From Station
    PaidReportComponent.prototype.getSourceList = function () {
        //        this.srcList="";
        this.srcLists = this.userDataDtoReturnSession.stationList;
        //        console.log(this.srcLists);
        //        this.srcList.subStations = this.srcLists;
        this.newAttribute.subStations = this.srcLists;
        this.lrDtosSourceOptionsGet = [];
        for (var i = 0; i < this.newAttribute.subStations.length; i++) {
            this.lrDtosSourceOptionsGet.push(this.newAttribute.subStations[i]);
            //            console.log(this.lrDtosSourceOptionsGet);
        }
        //        console.log(this.lrDtosSourceOptionsGet);
        this.lrDtoBkgSrcAll.subStations = "ALL";
        this.lrDtosSourceOptionsGet.push(this.lrDtoBkgSrcAll);
    };
    //  To Station 
    PaidReportComponent.prototype.getDestinationDetails = function () {
        this.lrDtoDestination.companyId = this.userDataDtoReturnSession.companyId;
        this.lrDtoDestination.mode = "Destination";
    };
    /// Get Agent Names
    PaidReportComponent.prototype.getAgentListDetails = function () {
        this.agentDto.companyId = this.userDataDtoReturnSession.companyId;
        this.agentDto.column2 = "Working";
        this.agentDto.mode = "Sub";
        this.agentDto.status = "All";
        if (this.isAgentAll == "AgentAll") {
            this.agentDto.mode = "Sub";
            this.agentDto.status = "All";
        }
        else {
            this.agentDto.mode = "mainBranch";
            if (this.mainStationRpt == 'Paid Rpt Bkg Main Station') {
                this.agentDto.mainStation = this.userDataDtoReturnSession.mainStation;
            }
            else {
                this.agentDto.mainStation = this.userDataDtoReturnSession.mainAdminStation;
            }
        }
        this.getAgentList();
    };
    ///get Consignor Index
    PaidReportComponent.prototype.getConsignorIndexvalue = function () {
        for (var i = 0; i < this.consignorIndexOptions.length; i++) {
            this.consignorIndexOptionsGet.push({ label: this.consignorIndexOptions[i], value: i });
        }
    };
    ////Get Consignor Name 
    PaidReportComponent.prototype.getConsignorInfo = function () {
        this.partyDto.companyId = this.userDataDtoReturnSession.companyId;
        //        this.indexVal = $( "#consignorIndex" ).val();
        //        this.indexVal = "Select Consignor Index";
        this.indexVal = "A";
        //        this.gstConsignor = $( "#consignorGstNumber" ).val();
        //        this.gstConsignor ="06AAACH8287K1Z5";
        this.partyDto.indexValue = this.indexVal;
        this.partyDto.gstNoConsignor = this.gstConsignor;
        if ((this.indexVal != null)
            && (this.indexVal == "Select Consignor Index")) {
            if (this.gstConsignor != null) {
                this.partyDto.mode = "LREntry";
                this.getConsignorDetailsList();
            }
        }
        else if ((this.indexVal != null)
            && (this.indexVal == "ALL")) {
            if (this.gstConsignor != null) {
                this.partyDto.mode = "LREntry";
            }
            else {
                this.partyDto.mode = "Index";
                this.partyDto.indexValue = "";
            }
            if (this.partyDto.mode != null) {
                this.getConsignorDetailsList();
            }
        }
        else {
            if (this.gstConsignor != null) {
                this.partyDto.mode = "IndexTinNo";
            }
            else {
                this.partyDto.mode = "Index";
            }
            if (this.partyDto.mode != null) {
                this.getConsignorDetailsList();
            }
        }
    };
